class Js{constructor(){this.print=function(a){console.log(a)},this.selectClass=function(a){const b=document.getElementsByClassName(a);for(var c=[],d=0;d<=b.length-1;d++)c.push(b[d]);return c},this.selectTag=function(a){document.getElementsByTagName(a)},this.selectId=function(a){document.querySelector("#"+a)}}}